import './App.css';

function Nav(){
    const nav = {news:'Новости', home: 'Главная', tri:'Три', chetire:'Четыре', pyat:'Пять'}
    return (
        <>
            <ul>
                <li>{nav.news}</li>
                <li>{nav.home}</li>
                <li>{nav.tri}</li>
                <li>{nav.chetire}</li>
                <li>{nav.pyat}</li>
            </ul>
        </>
    );
}

export default Main
